import React from 'react';
import './App.css';
import './Pages/Covit-19 Live Stats/node_modules/bootstrap/dist/css/bootstrap.min.css';
import NavBer from './Components/NavBer'
import NavBer1 from './Components/NavBer1'
import Stats from './Pages/Covit-19 Live Stats/Stats'
import { BrowserRouter } from 'react-router-dom';
import MyRouter from './Components/Router/MyRouter';

function App() {
  return (
    <div className="App">

        <BrowserRouter>
        <NavBer1/>
        <NavBer/>
        <MyRouter/>
        </BrowserRouter>
    </div>
  );
}

export default App;
